import axios from 'axios';

export class AccountsRepository {

    url = 'http://localhost:8000/users'

    config = {
    };

    getAccounts() {
        return new Promise((resolve, reject) => {
            axios.get(`${this.url}`, this.config)
                .then(x => resolve(x.data))
                .catch(x => {
                    console.log(x);
                    alert(x); // handle error
                    reject(x);
                });
        });
    }

}
